def wordBreak(s, dict):
    # write your code here
    #use DP
    n = len(s)
    if s in dict or n == 0:
        return(True)
    o = [False]*(n+1) #store solution for s[0..i-1], i is length
    o[0] = True
    realDict = {}
    for i in dict:
        realDict[i] = True
    for i in xrange(1,n+1):
        for j in realDict:
            lenJ = len(j)
            if lenJ <= i:
                if o[i-lenJ] and s[i-lenJ:i] == j:
                    o[i] = True
                    break
    return(o[-1])
if __name__ == '__main__':
    wordBreak("", ["a","b","c","d","e","f","g"])
